import * as React from "react";
import { useRoutes } from "react-router-dom";

import Home from './pages/home.js';
import Contact from './pages/contact.js';

const App = () => {

    let routes = useRoutes([
        { path: "/", element: <Home /> },
        { path: "/contacto", element: <Contact /> },
    ]);

    return routes;
}

export default App;
